    var styleStr = "";
    for(var i in cssjson){
        styleStr += i + " {\n";
        for(var j in cssjson[i]){
                styleStr += "\t" + j + ":" + cssjson[i][j] + ";\n";
        }
        styleStr += "}\n";
    }

    var style = window.document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = styleStr;
    document.getElementsByTagName("HEAD")[0].appendChild(style);

    //lifted rep summary processing from http://meta.stackoverflow.com/questions/12053/

    unsafeWindow.updatePrefs = function(preferences) {
        window.setTimeout(function() {
            GM_setValue(preferences.host+"_preferences", preferences.toSource());
        }, 0);
    };

    var host = window.location.host;
    host = host.substring(0, host.indexOf('.'));

    //read or construct default preferences
    var preferences = eval(GM_getValue(host+"_preferences", {
        lockHeader:true,
        updateRep:true,
        timer:true,
        setTitle:false,
        updateQuestions:false,
        host:host
    }));

    function getCheckBoxHtml(preferenceField, labelText) {
        return '<label for="'+preferenceField+'" class="labelCheckbox" id="'+preferenceField+'_label">' +
                    '<input type="checkbox" name="'+preferenceField+'"_checkbox" ' +
                    'id="'+preferenceField+'_checkbox" class="inputCheckbox" ' +
                    'value="'+labelText+'" /> '+labelText+'</label>';
    }
    function createPreferences(repUrl) {
        //preferences image
        //TODO gold versions of other sites...
        var soGold = "data:image/png;base64,";
        
        //create div to hold preferences tooltip
        $("<div></div>").attr("id","hiddenPrefs").attr("class","container").hide().prependTo("body");

        var fieldSet = $('<fieldset id="preferences"></fieldset>').prependTo("#hiddenPrefs");
        /*var legend = $("<legend></legend>").prependTo("#preferences");
        $(legend).html("Preferences");*/

        fieldSet.html('<label class="labelCheckbox">Preferences</label>' +
            getCheckBoxHtml("lockHeader", "Lock header to top of page") +
            getCheckBoxHtml("updateRep", "Update reputation") +
            getCheckBoxHtml("latestVote", "Show latest vote in header") +
            getCheckBoxHtml("setTitle", "Show today's rep in window title") +
            getCheckBoxHtml("timer", "Show remaining time for rep limit") +
            getCheckBoxHtml("updateQuestions", "Update questions"));

        var preferenceActions = $("<div></div>").attr("id","preferenceActions").appendTo(fieldSet);

        preferenceActions.html('<a class="labelCheckbox savePreferences">Save</a><a class="labelCheckbox cancelPreferences">Cancel</a>');
    
        //add the preferences arrow to the new header
        var preferencesDiv = $("<div></div>").attr("id","preferencesContainer").prependTo('#header:first');
        //add the preferences arrow to the new header
        var preferencesLink = $('<a class="preferencesLink" href="#hiddenPrefs" rel="#hiddenPrefs"></a>').prependTo('#preferencesContainer');
        //preferencesLink.html("&#9660;");
        preferencesLink.html('<img src="'+soGold+'" width="16" height="17"/>');

        $('a.preferencesLink').cluetip({
            local: true,
            width: 'auto',
            height: 'auto',
            clickThrough: false,
            dropShadow: false,
            sticky: true,
            /*closePosition: 'bottom',
            closeText: 'Cancel',*/
            fx: {
                open: 'slideDown',
                openSpeed: 'slow'
            },
            hoverIntent: {
               sensitivity:3,
                interval:50,
                timeout:0
            },
            onShow: function(ct) {

                function setEnabled(fieldName, isEnabled) {
                    $('#'+fieldName+'_checkbox', ct).attr('disabled',!isEnabled);
                }
                    
                //hide the default, unstyled close link
                $('div#cluetip-close:first', ct).hide();
                
                //TODO refactor this
                $('#lockHeader_checkbox', ct).attr('checked', preferences.lockHeader);
                $('#updateRep_checkbox', ct).attr('checked', preferences.updateRep);
                
                $('#updateRep_checkbox', ct).click(function(e){
	            setEnabled('latestVote', $(this)[0].checked);
	            setEnabled('setTitle', $(this)[0].checked);
	        }); 

                setEnabled('latestVote', preferences.updateRep);
                setEnabled('setTitle', preferences.updateRep);
                
                $('#latestVote_checkbox', ct).attr('checked', preferences.latestVote);                
                $('#setTitle_checkbox', ct).attr('checked', preferences.setTitle);
                $('#timer_checkbox', ct).attr('checked', preferences.timer);
                $('#updateQuestions_checkbox', ct).attr('checked', preferences.updateQuestions);
	        
                $('#cluetip-inner .savePreferences').click(function(){
                    preferences.lockHeader = $('#lockHeader_checkbox', ct).is(':checked');
                    preferences.updateRep = $('#updateRep_checkbox', ct).is(':checked');
                    preferences.latestVote = $('#latestVote_checkbox', ct).is(':checked');                        
                    preferences.setTitle = $('#setTitle_checkbox', ct).is(':checked');
                    preferences.timer = $('#timer_checkbox', ct).is(':checked');
                    preferences.updateQuestions = $('#updateQuestions_checkbox', ct).is(':checked');
                    unsafeWindow.updatePrefs(preferences);

                    //$(document).trigger('hideCluetip');
                    $('#cluetip').toggle();
                    update();

                });

                $('#cluetip-inner .cancelPreferences').click(function(){
                    $('#cluetip').toggle();
                });
            }
        });
    }
    
    $(function() {
        $('.container:first').attr("id","mainContainer");

        createPreferences(repUrl);

        var logoutLink = $("#topbar a[href^='/users/logout']:first");

        if(logoutLink.length) {
            var link = $("#topbar a[href^='/users/recent/']:first");
            var today = new Date();
            var UTCtoday = today.getUTCFullYear() + '-' + GM_fixNumber(today.getUTCMonth()+1) + '-' + GM_fixNumber(today.getUTCDate());

            var regex = new RegExp("^([\\d]{4})-([\\d]{2})-([\\d]{2}) ([\\d]{2}):([\\d]{2}):([\\d]{2})Z$");

            var currentUserId = $("#hlinks a[href^='/users/recent/']").attr("href").split("/")[3].split("?")[0];

            var url = '/users/recent/'+currentUserId+'?startdate=' + UTCtoday + '&enddate=' + UTCtoday;

            $("<span></span>").attr("class","goldPlatedStats").prependTo("#hlinks");
            
            var separator = logoutLink.prev();

            $('.reputation-score:first').attr("id", "reputation-score");

            var repUrl = '/users/recent/'+currentUserId+'?startdate=' + UTCtoday + '&enddate=' + UTCtoday + '&tab=reputation#sort-top';

            var previousRep = -1;

            var currentUrl = window.location.href;

            var count = 0;
            
            var timer = function() {
                //add/remove elements based on the current preferences
                if(preferences.lockHeader) {
                    if(!$('#scoreBarContainer')[0]) {
                        if($('#notify-table')[0]) {
                            //the notify header is being displayed, move the header down.by the height of the table
                            $('#header').css("margin-top", $('#notify-table:first').height());
                        }
                        $("<div></div>").attr("id","spacer").css("height","115px").prependTo("#mainContainer");
                        
                        //TODO this is a bit messy, but need to ensure the top of the page is not hidden by the
                        //header section, so copy the element to keep the same height
                        $("<div></div>").attr("id","scoreBarContainer").attr("class","container").prependTo("body");
                        $("<div></div>").attr("id","scoreBar").prependTo("#scoreBarContainer");
                        $('#scoreBar').append($('#header'));
                        
                    }
                } else {
                    if($('#scoreBarContainer')[0]) {
                        $('#header').prependTo("#mainContainer");
                        $('#scoreBarContainer').remove();
                        $('#spacer').remove();
                    }
                }
                
                if(preferences.updateRep) {
                    var doUpdate = (count % 60 === 0);
                    
                    if(!$('a.today-rep')[0]) {
                        $('<a class="reputation-score today-rep" href="'+repUrl+'" rel="#hiddenVoteData"></a>').prependTo('.goldPlatedStats');
                        var statsSeparator = separator.clone();
			            
			statsSeparator.insertAfter('.today-rep');
                        statsSeparator.addClass("stats-separator");
                        
                        $('a.today-rep').cluetip({
                            local: true,
                            width: 200,
                            clickThrough: true,
                            dropShadow: false,
                            fx: {
                                open: 'slideDown',
                                openSpeed: 'slow'
                            }/*,
                            hoverIntent: {
                                sensitivity:3,
                                interval:50,
                                timeout:0
                            }*/
                        });
                        
                        doUpdate = true;                    
                    }
                    if(!$('#hiddenVoteData')[0]) {
                        $("<div></div>").attr("id","hiddenVoteData").attr("class","container").hide().prependTo("body");
                    }
                    if(preferences.latestVote) {
                        if(!$('#hmenus .latest-upvote')[0]) {
                            $('#hmenus').css('padding','0px 0 20px 5px');

                            var latestUpvote = $('<div class="latest-upvote"></div>').prependTo($('#hmenus'));
                            latestUpvote.css('padding','3px 0 3px 5px');
                            latestUpvote.css('height','28px');

                            $("<table></table>").attr("id","latestUpvoteTable").prependTo(latestUpvote);
                            var latestUpvoteBody = $("<tbody></tbody>").attr("id","latestUpvoteBody").prependTo("#latestUpvoteTable");
                            
                            updateHistory();
                        }
                    } else {
                        deleteLatestVote();
                    }
                   
                    if(doUpdate) {
                        repCallback();
                    }
                } else {
                    deleteLatestVote();
                    $('a.today-rep').remove();
                    $('.stats-separator').remove();

                    var title = document.title.split(") ");
                    if(title.length > 1) {
                        document.title = title[1];
                    }
                }

                if(preferences.timer) {
                    if(!$('span.timer')[0]) {
                        $('<span class="badgecount timer"></span>').appendTo('.goldPlatedStats');
                        var statsSeparator = separator.clone();
			            
			statsSeparator.insertAfter('.timer');
                        statsSeparator.addClass("timer-separator");
                    }
                    var now = new Date();
                    var nextSess = new Date(now.getFullYear(), now.getMonth(), now.getDate()+1, 0, 0-now.getTimezoneOffset(), 0);

                    if(nextSess.getTime() <= now.getTime()) {
                        nextSess.setDate(nextSess.getDate()+1);
                    }

                    var diff = parseInt((nextSess.getTime() - now.getTime()) / 1000, 10);

                    var hours = parseInt(diff / 3600, 10);
                    var minutes = parseInt((diff % 3600) / 60, 10);
                    var seconds = diff % 60;

                    var settext = GM_fixNumber(hours) + ':' + GM_fixNumber(minutes) + ':' + GM_fixNumber(seconds);

                    $('span.timer').text(settext);
                } else {
                    $('span.timer').remove();
                    $('.timer-separator').remove();
                }

                if(preferences.updateQuestions) {
                    if(count % 60 === 0) {
                        questionsCallback();
                    }
                }
                
                if(count > 60) {
                    count = 0;
                }
                
                count++;
            };

            function deleteLatestVote() {
                if($('#hmenus .latest-upvote:first')) {
                    $('#hmenus').css('padding','34px 0 20px 5px');
                    $('#hmenus .latest-upvote:first').remove();
                }            
            }
            
            function getLastUpdate(element) {
                if(element.length == 0) {
                    return;
                }
                var topElement = $('tr:first', element);

                if(!topElement) {
                    return;
                }

                topElement = topElement.clone();
                
                if($('td', topElement).length === 1) {
                    return;
                }

                //TODO restore the time, but make smaller
                $('td:first', topElement).remove();
                $('td', topElement).css('vertical-align','middle');

                //TODO refactor
                var elementDiv = $('.upvote', topElement);

                if(!elementDiv.html()) {
                    elementDiv = $('.accept', topElement);
                }                
                if(!elementDiv.html()) {
		    elementDiv = $('.downvote', topElement);
                }
                

                //restyle the score box to fit in the space
                elementDiv.css('height','20px');
                elementDiv.css('width','75px');

                //remove the newline
                var upvoteHtml = elementDiv.html().split("<br>");
                elementDiv.html(upvoteHtml[0] + (upvoteHtml[1]?', ' +upvoteHtml[1]:""));

                return topElement;
            }

            var updateHistory = function(data, forceUpdate) {
                var latest;
                if(data !== undefined) {
                    latest = getLastUpdate($('.history-table tbody', data));

                    if(latest) {
                        if(!$('.history-table')[0]) {
                            var historyTable = $('.history-table', data);
                            $('#hiddenVoteData').css('margin-left','15px');
                            $('#hiddenVoteData').css('background','white');
                            $('#hiddenVoteData').css('border-color','#666666');
			    $('#hiddenVoteData').css('border-width','1px');
			    $('#hiddenVoteData').css('border-style','solid');
                            $('#hiddenVoteData').css('padding','5px 5px 5px 5px');
                            $('#hiddenVoteData').html(historyTable.html());
                        }
                    }
                } else {

                    latest = getLastUpdate($('#hiddenVoteData tbody'));                    
                }

                if(latest) {
                    if(preferences.latestVote) {  
                        $('#latestUpvoteBody').html(latest);
                        if(!forceUpdate) {
                            latest.hide().fadeIn("slow");
                        }
                    }
                }

            }
            var repCallback = function() {
                if(preferences.updateRep) {
                    $.get(url, function(data){
                        var todayRep = $('div#tabs a:eq(1) span.bounty-indicator-tab', data).text();

                        if(!todayRep) todayRep = 0;

                        var todayRepInt = parseInt(todayRep, 10);

                        var totalRep = $('.reputation-score',data).html();
                        
                        var forceUpdate = ($('.today-rep').html() === '');
                        
                        if(previousRep != todayRepInt || forceUpdate) {
                            if(preferences.setTitle) {
                                var title = document.title.split(") ");
                                if(title.length > 1) {
                                    title = title[1];
                                } else {
                                    title = title[0];
                                }
                                document.title = "(" + todayRepInt + ") " + title;
                            }

                            if(previousRep != -1) {
                                $('#reputation-score').html(totalRep);
                                if(!forceUpdate) {
                                    $('#reputation-score').fadeOut("slow").fadeIn("slow");
                                }
                                
                            }
                            $('.today-rep').html(todayRepInt);
                            if(!forceUpdate) {
                                $('.today-rep').fadeOut("slow").fadeIn("slow");
                            }

                            previousRep = todayRepInt;

                            if(todayRepInt >= 200) {
                                //visual cue that we've reached the limit
                                $('a.today-rep').css('color', '#BB00EE');
                                $('span.timer').css('color', '#BB00EE');
                            }

                            $.get(repUrl, function(data){updateHistory(data, forceUpdate)});
                        }
                    });
                }
            };

            function getQuestionsUrl(currentUrl, page) {
                if("/questions" === currentUrl.substr(-10)) {
                    return '/questions?sort='+page;
                }

                var sections = currentUrl.split("/");

                if((sections[sections.length - 3] === "questions") &&
                    (sections[sections.length - 2] === "tagged")) {
                    return "/questions/tagged/" + sections[sections.length - 1];
                }
            }

            var questionsCallback = function() {
                var page="newest";
                if($('#questions') && page === $('a.youarehere').html()) {
                    var questionsUrl = getQuestionsUrl(currentUrl, page);

                    if(questionsUrl) {
                        $.get(questionsUrl, function(data) {
                            //get the top question on the current page
                            var latest = parseInt($('#questions .question-summary:first').attr("id").split("-")[2]);

                            var questions = $('#questions .question-summary',data);

                            for (var j=(questions.length -1); j > -1; j--) {
                                var currentId = parseInt($(questions[j]).attr("id").split("-")[2]);
                                if(currentId > latest) {
                                    $(questions[j]).hide().prependTo('#questions').fadeIn("slow");
                                } else {
                                    //might as well replace any existing questions with the new version
                                    var currentQuestion = $('#question-summary-'+currentId+':first');

                                    if(currentQuestion) {
                                        $(currentQuestion).html($(questions[j]).html());
                                    }
                                }
                            }
                        });
                    }
                }
            };

            setInterval(timer, 1000);
        }

        function GM_fixNumber(num) {
            if(num < 10) return '0' + num;
            return num;
        }
    })();
